import { Component, useEffect, useState } from "react";
import {Link} from 'react-router-dom';
import axios from "axios";
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import { Button, ButtonGroup } from "@mui/material";
import productsStyle from "../styles/product.style";
import store from "../useStore/useStoreProduct";


/*interface  Products{
    id: number,
    title: string,
    price: number,
    description: string,
    published: number,
    sizeId: number,
} */

const Home : React.FC = () => {
  const classes=productsStyle()
 // const [ProductsData, setProductsData] = useState<Products[] | null>(null);
 const [ProductsData, setProductsData] = useState<Array<store.Products>>([]);
 //const [ProductsData, setProductsData] = useState<store.Products[]>([]);
 
 useEffect(() => {
    getProducts();
 }, []);
  
 const getProducts = async () => {
 const response = await axios.get("http://localhost:3001/api/products/get-all-products");
 if (response.status== 200){
  setProductsData(response.data.data);
 }

 };
 console.log("data=>", ProductsData);
    return (
        <div style={{marginTop: "50px"}}>
      <TableContainer component={Paper}>
       <Table sx={{ minWidth: 900 }} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>ID</TableCell>
            <TableCell align="right">Title</TableCell>
            <TableCell align="right">Price</TableCell>
            <TableCell align="right">Description</TableCell>
            <TableCell align="right">Published</TableCell>
            <TableCell align="right">Size</TableCell>
            <TableCell align="center">Action</TableCell>
          </TableRow>
        </TableHead>
         <TableBody>
          
          {ProductsData && ProductsData.map((item, index) => {
            console.log("item",item)
              return (
            <TableRow
              key={index}
              //sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
              <TableCell  scope="row">
                {item.id}
              </TableCell>
              <TableCell align="right">{item.title}</TableCell>
              <TableCell align="right">{item.price}</TableCell>
              <TableCell align="right">{item.description}</TableCell>
              <TableCell align="right">{item.published}</TableCell>
              <TableCell align="right">{item.sizeId}</TableCell>
              <TableCell align="center">
               <div className={classes.buttonStyle}>
               <ButtonGroup variant="contained" aria-label="contained primary button group">
                 <Button color="primary">Edit</Button>
                 <Button color="secondary">Delete</Button>
                 <Button color="success">View</Button>
               </ButtonGroup>
               </div> 
              </TableCell>
            </TableRow>
              );
           })}
          </TableBody>  
        
      </Table>
    </TableContainer>
        
        </div>
    )

}
export default Home;
